from collections import deque

def min_steps_to_zero(num1, num2):
    if num1 == 0:
        return 0

    # Generate allowed values
    allowed_values = [2 ** i + num2 for i in range(61)]

    visited = set()
    queue = deque()
    queue.append((num1, 0))
    visited.add(num1)

    while queue:
        current_value, steps = queue.popleft()

        for s in allowed_values:
            new_value = current_value - s
            if new_value < 0:
                continue
            if new_value not in visited:
                visited.add(new_value)
                queue.append((new_value, steps + 1))
                if new_value == 0:
                    return steps + 1

    return -1

